import {SET_SEARCH_RESULT,SET_SEARCH_STATUS} from './action';

const INITIAL_STATE ={
    searchResult:[],
    searched:false
}

export default function (state=INITIAL_STATE,action){
    switch (action.type) {
        case 'SET_SEARCH_RESULT': {
          return {
          ...state,
                 searchResult: action.payload
          }
        }
        case 'SET_SEARCH_STATUS': {
            return {
                searched:action.payload 
            }
          }

        default:
          return state
      }
}
